#
# TABLE STRUCTURE FOR: post_fake
#

DROP TABLE IF EXISTS `post_fake`;

CREATE TABLE `post_fake` (
  `id` int(9) unsigned NOT NULL AUTO_INCREMENT,
  `usuario_id` int(9) unsigned NOT NULL,
  `categoria_id` int(9) unsigned NOT NULL,
  `capa` varchar(255) NOT NULL,
  `slug` varchar(255) NOT NULL,
  `titulo` varchar(255) NOT NULL,
  `texto` varchar(255) NOT NULL,
  `status` int(11) NOT NULL,
  `visitas` int(11) NOT NULL,
  `cadastrado_em` datetime NOT NULL,
  `atualizado_em` datetime DEFAULT NULL,
  `ultima_visita` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=10001 DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_general_ci;



#
# TABLE STRUCTURE FOR: posts_fake
#

DROP TABLE IF EXISTS `posts_fake`;

CREATE TABLE `posts_fake` (
  `slug` varchar(255) NOT NULL,
  `titulo` varchar(255) NOT NULL,
  `texto` varchar(255) NOT NULL,
  `status` int(11) NOT NULL,
  `visitas` int(11) NOT NULL,
  `cadastrado_em` datetime NOT NULL,
  `atualizado_em` datetime DEFAULT NULL,
  `ultima_visita_em` datetime DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_general_ci;

